package simple.calculator.inheritance;

public class Multiply implements MathCalculations {

	/**
	 * calculateInt method for integer calculations
	 * 
	 * @param two integer numbers
	 * @return integer result of multiplying parameters.
	 */
	@Override
	public int calculateInt(int a, int b) {
		// TODO Auto-generated method stub
		return a * b;
	}

}
